import React from "react";
import "./Home.css";
import heroBg1 from "../assets/images/hero-bg.jpg";
import burger2 from "../assets/images/burger2.jpg";
import burger3 from "../assets/images/burger3.jpg";

const Home = () => {
  return (
    <section id="home" className="home">
      <div className="hero">
        <div className="hero-text">
          <h1>Selamat Datang Di NetNibbles</h1>
          <p>
            NetNibbles merupakan pilihan tepat untuk memuaskan rasa lapar Anda
            dengan hidangan lezat dan cepat saji. Kami menawarkan berbagai menu
            favorit seperti burger, ayam goreng, dan masih banyak lagi.
          </p>
          <a href="#menu" className="btn">
            Telusuri Lebih
          </a>
        </div>
        <div className="hero-images">
          <img src={heroBg1} alt="Burger 1" />
          <img src={burger2} alt="Burger 2" />
          <img src={burger3} alt="Burger 3" />
        </div>
      </div>
    </section>
  );
};

export default Home;
